INSERT INTO `risk_api_document` VALUES ('215', 'pullCaptcha', '{\r\n    apiCode: \'pullCaptcha\',\r\n    apiName: \'重置当前数据源对应的服务密码时获取验证码\',\r\n    note: \'如果忘记当前采集源的服务密码，通过重置功能，先获取验证码，然后下一接口提交新的密码及此接口获取的验证码\',\r\n    ts: \'2017-06-30\',\r\n    requestuUrl: \'https://data.imfbp.com/risk/api/mf/collection/pullCaptcha\',\r\n    requestMethod: \'POST\',\r\n    contentType: \'application/x-www-form-urlencoded\',\r\n    returnType: \'JSON\',\r\n    requestSample: [\r\n    {\r\n      type: \'curl\',\r\n      example: \'\'\r\n    },\r\n    {\r\n      type: \'Java\',\r\n      example: \'<div class=\"dp-highlighter\"><div class=\"bar\"></div><ol start=\"1\" class=\"dp-j\"><li class=\"alt\"><span><span class=\"keyword\">public</span><span>&nbsp;</span><span class=\"keyword\">static</span><span>&nbsp;</span><span class=\"keyword\">void</span><span>&nbsp;main(String[]&nbsp;args)&nbsp;</span><span class=\"keyword\">throws</span><span>&nbsp;Exception{&nbsp;&nbsp;</span></span></li><li class=\"\"><span>&nbsp;&nbsp;&nbsp;&nbsp;Map&lt;String,&nbsp;String&gt;&nbsp;params&nbsp;=&nbsp;<span class=\"keyword\">new</span><span>&nbsp;HashMap&lt;String,&nbsp;String&gt;();&nbsp;&nbsp;</span></span></li><li class=\"alt\"><span>&nbsp;&nbsp;&nbsp;&nbsp;params.put(<span class=\"string\">\"account\"</span><span>,&nbsp;</span><span class=\"string\">\"账户\"</span><span>);&nbsp;&nbsp;</span></span></li><li class=\"\"><span>&nbsp;&nbsp;&nbsp;&nbsp;params.put(<span class=\"string\">\"accessKey\"</span><span>,&nbsp;</span><span class=\"string\">\"访问凭证\"</span><span>);&nbsp;&nbsp;</span></span></li><li class=\"alt\"><span>&nbsp;&nbsp;&nbsp;&nbsp;params.put(<span class=\"string\">\"sTransactionId\"</span><span>,&nbsp;</span><span class=\"string\">\"小于等于30位数字的流水号\"</span><span>);&nbsp;&nbsp;</span></span></li><li class=\"\"><span>&nbsp;&nbsp;&nbsp;&nbsp;params.put(<span class=\"string\">\"token\"</span><span>,&nbsp;</span><span class=\"string\">\"提交申请单时候获取的token\"</span><span>);&nbsp;&nbsp;</span></span></li><li class=\"alt\"><span>&nbsp;&nbsp;&nbsp;&nbsp;params.put(<span class=\"string\">\"loginName\"</span><span>,&nbsp;</span><span class=\"string\">\"用户名或手机号\"</span><span>);&nbsp;&nbsp;</span></span></li><li class=\"\"><span>&nbsp;&nbsp;&nbsp;&nbsp;params.put(<span class=\"string\">\"website\"</span><span>,&nbsp;</span><span class=\"string\">\"网站的英文名，从上一步骤数据源处获取\"</span><span>);&nbsp;&nbsp;</span></span></li><li class=\"alt\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></li><li class=\"\"><span>&nbsp;&nbsp;&nbsp;&nbsp;HttpPost&nbsp;httpPost&nbsp;=&nbsp;<span class=\"keyword\">new</span><span>&nbsp;HttpPost(</span><span class=\"string\">\"https://data.imfbp.com/risk/api/mf/collection/pullCaptcha\"</span><span>);&nbsp;&nbsp;&nbsp;&nbsp;</span></span></li><li class=\"alt\"><span>&nbsp;&nbsp;&nbsp;&nbsp;List&lt;NameValuePair&gt;&nbsp;pairLst&nbsp;=&nbsp;<span class=\"keyword\">new</span><span>&nbsp;ArrayList&lt;NameValuePair&gt;();&nbsp;&nbsp;&nbsp;&nbsp;</span></span></li><li class=\"\"><span>&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"keyword\">for</span><span>&nbsp;(Map.Entry&lt;String,&nbsp;String&gt;&nbsp;entry&nbsp;:&nbsp;params.entrySet())&nbsp;{&nbsp;&nbsp;&nbsp;&nbsp;</span></span></li><li class=\"alt\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;pairLst.add(<span class=\"keyword\">new</span><span>&nbsp;BasicNameValuePair(entry.getKey(),&nbsp;entry.getValue()));&nbsp;&nbsp;&nbsp;&nbsp;</span></span></li><li class=\"\"><span>&nbsp;&nbsp;&nbsp;&nbsp;}&nbsp;&nbsp;&nbsp;&nbsp;</span></li><li class=\"alt\"><span>&nbsp;&nbsp;&nbsp;&nbsp;httpPost.setEntity(<span class=\"keyword\">new</span><span>&nbsp;UrlEncodedFormEntity(pairLst,&nbsp;</span><span class=\"string\">\"UTF-8\"</span><span>));&nbsp;&nbsp;&nbsp;&nbsp;</span></span></li><li class=\"\"><span>&nbsp;&nbsp;&nbsp;&nbsp;CloseableHttpResponse&nbsp;response&nbsp;=&nbsp;HttpClients.createDefault().execute(httpPost);&nbsp;&nbsp;&nbsp;&nbsp;</span></li><li class=\"alt\"><span>&nbsp;&nbsp;&nbsp;&nbsp;System.out.println(EntityUtils.toString(response.getEntity(),&nbsp;<span class=\"string\">\"UTF-8\"</span><span>));&nbsp;&nbsp;</span></span></li><li class=\"\"><span>}&nbsp;&nbsp;</span></li></ol></div>\'\r\n    },\r\n    {\r\n      type: \'PHP\',\r\n      example: \'\'\r\n    }\r\n  ],\r\n    requestParams: [\r\n        {name: \"account\", type: \'String\', isNeed: \'必填\', note: \'账户\'},\r\n        {name: \'accessKey\',type: \'String\',isNeed: \'必填\',note: \'访问凭证\'},\r\n        {name: \"sTransactionId\", type: \'String\', isNeed: \'选填\', note: \'流水号,小于等于30位的一串数字，用于定位该次请求\'},\r\n        {name: \"token\", type: \'String\', isNeed: \'必填\', note: \'提交申请单处获取的token\'},\r\n        {name: \"loginName\", type: \'String\', isNeed: \'必填\', note: \'网站账号（移动运营商为手机号码）\'},\r\n        {name: \"website\", type: \'String\', isNeed: \'必填\', note: \'网站英文名称\'}      \r\n      ],\r\n    returnParams: [\r\n        {name: \'code\', type: \'int\', note: \'结果编码\'},\r\n        {name: \'msg\', type: \'String\', note: \'对结果编码的解释\'},\r\n        {name: \'data\', type: \'dddd\', note: \'结果参考数据字典\'}\r\n      ],\r\n    resultSuccessCodes: \'<div class=\"dp-highlighter\"><div class=\"bar\"></div><ol start=\"1\" class=\"dp-j\"><li class=\"alt\"><span><span>{&nbsp;&nbsp;</span></span></li><li class=\"\"><span>&nbsp;&nbsp;<span class=\"string\">\"msg\"</span><span>&nbsp;:&nbsp;</span><span class=\"string\">\"success\"</span><span>,&nbsp;&nbsp;</span></span></li><li class=\"alt\"><span>&nbsp;&nbsp;<span class=\"string\">\"code\"</span><span>&nbsp;:&nbsp;</span><span class=\"number\">200</span><span>,&nbsp;&nbsp;</span></span></li><li class=\"\"><span>&nbsp;&nbsp;<span class=\"string\">\"data\"</span><span>&nbsp;:&nbsp;{&nbsp;&nbsp;</span></span></li><li class=\"alt\"><span>&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"string\">\"process_code\"</span><span>&nbsp;:&nbsp;</span><span class=\"number\">10002</span><span>,&nbsp;&nbsp;</span></span></li><li class=\"\"><span>&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"string\">\"finish\"</span><span>&nbsp;:&nbsp;</span><span class=\"keyword\">false</span><span>,&nbsp;&nbsp;</span></span></li><li class=\"alt\"><span>&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"string\">\"type\"</span><span>&nbsp;:&nbsp;</span><span class=\"string\">\"CONTROL\"</span><span>,&nbsp;&nbsp;</span></span></li><li class=\"\"><span>&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"string\">\"content\"</span><span>&nbsp;:&nbsp;</span><span class=\"string\">\"输入动态密码\"</span><span>&nbsp;&nbsp;</span></span></li><li class=\"alt\"><span>&nbsp;&nbsp;}&nbsp;&nbsp;</span></li><li class=\"\"><span>}&nbsp;&nbsp;</span></li></ol></div>\',\r\n   resultDDCodes:[{\r\n      title:\'结果数据字典\',\r\n      infos: [\r\n        {name: \'type\', type: \'String\', note: \'CONTROL控制类型的响应结果 \\n ERROR错误类型的响应结果 \\n RUNNING 正在运行（超时会出现）\'},\r\n        {name: \'process_code\',type: \'int\',note: \'参考《process_code说明》\'},\r\n        {name: \'finish\',type: \'boolean\',note: \'所有的采集流程是否结束\'},\r\n        {name: \'content\',type: \'String\',note: \'消息提示\'}\r\n\r\n      ]\r\n    }    \r\n    ],\r\n    returnExtaCodes: [{\r\n      title:\'process_code说明\',\r\n      infos: [\r\n        {name: \'10001\', desc:\'再次输入短信验证码\', process: \'提交类型是SUBMIT_CAPTCHA的请求消息到提交采集请求【仅四川移动会出现】\'},\r\n        {name: \'10002\', desc:\'输入短信验证码 \\n 1.移动的号码在认证的时候可能需要两个，提交第一个之后继续返回10002，再次提交第二个 \\n 2.提交京东采集请求，如果需要短信验证码，返回10002；如果不需要，则直接返回10008\', process: \'【在获取采集响应中获取】 \\n 等用户输入短信验证码以后提交类型是SUBMIT_CAPTCHA的请求消息到提交采集请求\'},\r\n        {name: \'10003\', desc:\'密码错误\', process: \'用户重新请求采集接口\'},\r\n        {name: \'10004\', desc:\'短信验证码错误\', process: \'等用户输入短信验证码以后 \\n 提交类型是SUBMIT_CAPTCHA的请求消息到提交采集请求\'},\r\n        {name: \'10006\', desc:\'短信验证码失效系统已自动重新下发\', process: \'等用户输入短信验证码以后 \\n 提交类型是SUBMIT_CAPTCHA的请求消息到提交采集请求\'},\r\n        {name: \'30000\', desc:\'错误信息\', process: \'网络异常、运营商异常或当天无法下发短信验证码所导致的无法登陆【建议结束流程】\'},\r\n        {name: \'0\', desc:\'采集请求超时\', process: \'运营商网站异常或者服务更新升级导致不可用\'}\r\n      ]\r\n    }]\r\n }', '2017-07-07 17:42:55', '253', '2');
