INSERT INTO `risk_api_document` VALUES ('229', 'entCourtInfo', '{\r\n    apiCode: \'entCourtInfo\',\r\n    apiName: \'法院数据综合查询\',\r\n    note: \'通过关键词查询相关企业的信息返回如下信息:1.1）裁判文书（6项）；\r\n	1.2) 开庭公告（8项）；\r\n	1.3）执行公告（12项）；\r\n	1.4）失信公告（16项）；\r\n	1.5）法院公告（7项）\',\r\n    ts: \'2017-06-30\',\r\n    requestuUrl: \'https://data.imfbp.com/risk/api/companyInfo/noCom/entCourtInfo\',\r\n    requestMethod: \'POST\',\r\n    contentType: \'application/x-www-form-urlencoded\',\r\n    returnType: \'JSON\',\r\n    requestSample: [\r\n    {\r\n      type: \'curl\',\r\n      example: \'\'\r\n    },\r\n    {\r\n      type: \'Java\',\r\n      example: \'<div class=\"dp-highlighter\"><div class=\"bar\"></div><ol start=\"1\" class=\"dp-j\"><li class=\"alt\"><span><span class=\"keyword\">public</span><span>&nbsp;</span><span class=\"keyword\">static</span><span>&nbsp;</span><span class=\"keyword\">void</span><span>&nbsp;main(String[]&nbsp;args)&nbsp;</span><span class=\"keyword\">throws</span><span>&nbsp;Exception&nbsp;{&nbsp;&nbsp;</span></span></li><li class=\"\"><span>&nbsp;&nbsp;&nbsp;&nbsp;Map&lt;String,&nbsp;String&gt;&nbsp;params&nbsp;=&nbsp;<span class=\"keyword\">new</span><span>&nbsp;HashMap&lt;String,&nbsp;String&gt;();&nbsp;&nbsp;</span></span></li><li class=\"alt\"><span>&nbsp;&nbsp;&nbsp;&nbsp;params.put(<span class=\"string\">\"account\"</span><span>,&nbsp;</span><span class=\"string\">\"账户\"</span><span>);&nbsp;&nbsp;</span></span></li><li class=\"\"><span>&nbsp;&nbsp;&nbsp;&nbsp;params.put(<span class=\"string\">\"accessKey\"</span><span>,&nbsp;</span><span class=\"string\">\"访问凭证\"</span><span>);&nbsp;&nbsp;</span></span></li><li class=\"alt\"><span>&nbsp;&nbsp;&nbsp;&nbsp;params.put(<span class=\"string\">\"sName\"</span><span>,&nbsp;</span><span class=\"string\">\"用友网络信息技术有限公司\"</span><span>);</span><span class=\"comment\">//&nbsp;公司名称</span><span>&nbsp;&nbsp;</span></span></li><li class=\"\"><span>&nbsp;&nbsp;&nbsp;&nbsp;params.put(<span class=\"string\">\"datatype\"</span