update risk_api_document d, (select count(*) num, s_api_code from risk_api_invoke_log group by s_api_code) l set d.i_call_num = l.num where d.s_api_code = l.s_api_code;
update risk_api_invoke i,(select count(*) num, s_api_code,  from_unixtime(max(unix_timestamp(s_invode_time)),'%Y-%m-%d %H:%i:%s') invoke_time, s_visit_code from risk_api_invoke_log group by s_api_code,s_visit_code) l set i.i_call_num = l.num, i.s_last_call_time = l.invoke_time where i.s_user_code=l.s_visit_code and i.s_api_code = l.s_api_code;
update risk_api_invoke_log l set l.i_cost_mills = FLOOR(100 + (RAND() * 50));